import React from 'react';

const FishingSpotCard = ({ spot }) => (
    <div className="fishing-spot-card">
        <h3>{spot.title}</h3>
        <p>{spot.description}</p>
        <p>
            Location: {spot.location ? `${spot.location.lat}, ${spot.location.lng}` : 'N/A'}
        </p>
        <p>
            Species: {Array.isArray(spot.species) ? spot.species.join(', ') : spot.species}
        </p>
        <p>Technique: {spot.technique}</p>
        {spot.rating && <p>Rating: {spot.rating}</p>}
    </div>
);

export default FishingSpotCard;
